import classes from "./Header.module.css";
import meals from './meals.jpg'

export const Header = props => {
  return (
    <>
      <div class={classes.header}>
        <a class="active" >
          React Meals
        </a>

      </div>
      <img class={classes.mainImage} src={meals}></img>
    </>
  );
};

export default Header;
